import * as React from "react";
import styled from "styled-components";
import { CategorieProps } from "../pages/Home";

const CategoryTab: React.FC<CategorieProps> = (item) => {
  console.log(item);
  return (
    <Box>
      <Tab>{item.item.categoryName}</Tab>
    </Box>
  );
};

export default CategoryTab;

const Box = styled.div`
  position: absolute;
  top: 86px;
  left: 22px;
`;
const Tab = styled.div`
  display: flex;
  text-align: center;
  position: static;
  width: 26px;
  height: 14px;
  font-weight: 500;
  font-size: 14px;
  line-height: 14px;
`;
